description:
Fired (Jonathan Morgan / Wicked Pictures / 2008)

Brandy (Carmen Hart) just can't catch a break. After her one night stand turns off her alarm clock, she finds her fired, again. Now with the help of her two sexy but dingy roommates, she's determined to find a new career path. Unfortunately for Brandy, she just can't seem to get it right and as soon as she lands one job, she quickly makes a mess of things and finds herself back on the street. But it seems that eventually luck is on her side as one bumbling mistake leads her to the perfect position.

Carmen Hart, Hollly Wellin, Katie Morgan, Nikki Rhodes, Renae Cruz

Feature, Plot Based, Couples

